  const [user, setUser] = useContext(UserContext);

  console.log(user);

  return (
    <div className="Home">
        <h1>Welcome to your Home Page</h1>

        <div className="home_leagues">Leagues</div>
        <div className="home_teams">Teams</div>
        <div className="home_feed">Feed</div>



    </div>
  );
}

export default Home;
